	return (
		<fieldset className="popup__input-group">
			<input
				
				placeholder={props.placeholder}
			
				value={props.value}
				onChange={props.onChange}
			/>
			<span
				id="place-input-error"
				className="place-input-error popup__input-error"
			/>
		</fieldset>
	);
}
